import React from 'react';
import {
    View,
    Text,
    Button,
    StyleSheet
} from "react-native";

const Home = ({navigation}) => {
    return (
        <View style={styles.container}>
            <View style={styles.box1}>
                <View>
       

                </View>
            </View>
            <Text style={{
                color: 'black',
                fontFamily: 'Inter',
                fontSize: '36px',
                fontWeight: 600
            }}>
                    Click here to go to Shop 1
                    </Text>

                  
                        <Button title="Shop1"
                            onPress={() => navigation.navigate('Shop1')}
                        />
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: 'azure',
    },
    box1: {
        position: 'absolute',
        alignSelf: 'center',
        top: 40,
        width: '100%',
        height: '8%',
        backgroundColor: 'gray',
    },
    h1:{
        top:'15%'
        

    }










})

export default Home;
